// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "../core/PolicyBase.sol";

/// @title PolicyBaseMock
/// @notice Mock implementation of PolicyBase for testing
contract PolicyBaseMock is PolicyBase {
    // Define a policy data structure for testing
    struct MockPolicyData {
        string metadata;
        bool processed;
    }

    // Mapping to store mock policy data
    mapping(bytes32 => MockPolicyData) private mockPolicyData;

    constructor(address _trustedSigner) PolicyBase(_trustedSigner) {}

    /// @notice Process policy-specific data for the mock implementation
    function _processPolicyData(bytes32 policyId, bytes memory policyData) internal override {
        // Simple decoding for testing
        string memory metadata = abi.decode(policyData, (string));

        // Store the mock policy data
        mockPolicyData[policyId] = MockPolicyData({
            metadata: metadata,
            processed: true
        });
    }

    /// @notice Override the purchasePolicy function for testing
    /// This implementation allows calling without signature verification for test simplicity
    function purchasePolicy(
        address owner,
        string memory metadata,
        uint256 premium,
        uint256 sumAssured,
        uint256 duration
    ) public payable {
        require(owner != address(0), "Invalid owner address");
        require(premium > 0, "Premium must be positive");
        require(sumAssured > 0, "Sum assured must be positive");
        require(duration > 0, "Duration must be positive");
        require(msg.value == premium, "Incorrect premium amount");

        // Generate a unique policy ID
        bytes32 policyId = generatePolicyId(owner, block.timestamp);
        require(!policies[policyId].isActive, "Policy already exists");

        policies[policyId] = Policy({
            policyId: policyId,
            owner: owner,
            premium: premium,
            sumAssured: sumAssured,
            expiry: block.timestamp + duration,
            isActive: true,
            isClaimed: false,
            createdAt: block.timestamp
        });

        // Store the mock policy data
        mockPolicyData[policyId] = MockPolicyData({
            metadata: metadata,
            processed: true
        });

        emit PolicyPurchased(policyId, owner, premium, sumAssured, block.timestamp + duration);
    }

    /// @notice Test version of purchasePolicy that directly implements the signature verification
    function purchasePolicyWithSignature(
        address owner,
        string memory metadata,
        uint256 premium,
        uint256 sumAssured,
        uint256 duration,
        bytes memory signature
    ) public payable nonReentrant {
        require(owner != address(0), "Invalid owner address");
        require(premium > 0, "Premium must be positive");
        require(sumAssured > 0, "Sum assured must be positive");
        require(duration > 0, "Duration must be positive");
        require(msg.value == premium, "Incorrect premium amount");

        // Encode the policy data
        bytes memory policyData = abi.encode(metadata);

        // Create hash of the policy parameters for signature verification
        bytes32 messageHash = keccak256(
            abi.encodePacked(
                owner,
                policyData,
                premium,
                sumAssured,
                duration,
                block.chainid
            )
        );

        // Verify signature
        require(!usedSignatures[keccak256(signature)], "Signature already used");

        // Prefix the hash with Ethereum message prefix: "\x19Ethereum Signed Message:\n32"
        bytes32 ethSignedMessageHash = keccak256(
            abi.encodePacked("\x19Ethereum Signed Message:\n32", messageHash)
        );

        // Recover the signer
        address signer = recoverSigner(ethSignedMessageHash, signature);
        require(signer == trustedSigner, "Invalid signature");

        // Mark signature as used
        usedSignatures[keccak256(signature)] = true;

        // Generate a unique policy ID
        bytes32 policyId = generatePolicyId(owner, block.timestamp);
        require(!policies[policyId].isActive, "Policy already exists");

        policies[policyId] = Policy({
            policyId: policyId,
            owner: owner,
            premium: premium,
            sumAssured: sumAssured,
            expiry: block.timestamp + duration,
            isActive: true,
            isClaimed: false,
            createdAt: block.timestamp
        });

        // Store the mock policy data
        mockPolicyData[policyId] = MockPolicyData({
            metadata: metadata,
            processed: true
        });

        emit PolicyPurchased(policyId, owner, premium, sumAssured, block.timestamp + duration);
    }

    /// @notice Override the fileClaim function for testing
    /// This implementation allows calling without signature verification for test simplicity
    function fileClaim(
        bytes32 policyId,
        uint256 amount,
        string memory documentHash
    ) public nonReentrant validPolicy(policyId) {
        Policy storage policy = policies[policyId];
        require(policy.owner == msg.sender, "Not the policy owner");
        require(amount <= policy.sumAssured, "Claim exceeds sum assured");
        require(!policy.isClaimed, "Policy already claimed");
        require(block.timestamp < policy.expiry, "Policy expired");

        claims[policyId] = ClaimRequest({
            policyId: policyId,
            amount: amount,
            documentHash: documentHash,
            isPending: true,
            createdAt: block.timestamp,
            expiryTimestamp: block.timestamp + claimExpiryPeriod
        });

        emit ClaimFiled(policyId, policy.owner, amount, documentHash);
    }

    /// @notice Test version of fileClaim that directly implements signature verification
    function fileClaimWithSignature(
        bytes32 policyId,
        uint256 amount,
        string memory documentHash,
        bytes memory signature
    ) public nonReentrant validPolicy(policyId) {
        Policy storage policy = policies[policyId];
        require(policy.owner == msg.sender, "Not the policy owner");
        require(amount <= policy.sumAssured, "Claim exceeds sum assured");
        require(!policy.isClaimed, "Policy already claimed");
        require(block.timestamp < policy.expiry, "Policy expired");

        // Create hash of the claim parameters for signature verification
        bytes32 messageHash = keccak256(
            abi.encodePacked(
                policyId,
                amount,
                documentHash,
                block.chainid
            )
        );

        // Verify signature isn't used already
        require(!usedSignatures[keccak256(signature)], "Signature already used");

        // Prefix the hash with Ethereum message prefix: "\x19Ethereum Signed Message:\n32"
        bytes32 ethSignedMessageHash = keccak256(
            abi.encodePacked("\x19Ethereum Signed Message:\n32", messageHash)
        );

        // Recover the signer
        address signer = recoverSigner(ethSignedMessageHash, signature);
        require(signer == trustedSigner, "Invalid signature");

        // Mark signature as used
        usedSignatures[keccak256(signature)] = true;

        claims[policyId] = ClaimRequest({
            policyId: policyId,
            amount: amount,
            documentHash: documentHash,
            isPending: true,
            createdAt: block.timestamp,
            expiryTimestamp: block.timestamp + claimExpiryPeriod
        });

        emit ClaimFiled(policyId, policy.owner, amount, documentHash);
    }

    /// @notice Simplified approveClaim function for testing
    function approveClaim(bytes32 policyId) 
        public 
        override
        onlyRole(ADMIN_ROLE) 
        validPolicy(policyId) 
        nonReentrant 
        returns (uint256) 
    {
        ClaimRequest storage claim = claims[policyId];
        Policy storage policy = policies[policyId];

        require(claim.isPending, "No pending claim");
        require(block.timestamp <= claim.expiryTimestamp, "Claim request expired");

        claim.isPending = false;
        policy.isClaimed = true;
        policy.isActive = false;

        // For testing, we'll emit the event but not transfer funds
        // This avoids the "Payment failed" error in the tests
        emit ClaimApproved(policyId, policy.owner, claim.amount);
        return claim.amount;
    }

    /// @notice Simplified cancelPolicy function without signature verification
    function cancelPolicy(
        bytes32 policyId,
        uint256 refundAmount
    ) public onlyRole(ADMIN_ROLE) validPolicy(policyId) nonReentrant {
        Policy storage policy = policies[policyId];
        require(!policy.isClaimed, "Policy already claimed");
        require(block.timestamp < policy.expiry, "Policy expired");

        // Change state before transfer to prevent reentrancy
        policy.isActive = false;

        // Transfer the refund
        (bool sent, ) = payable(policy.owner).call{value: refundAmount}("");
        require(sent, "Refund transfer failed");

        emit PolicyCancelled(policyId, policy.owner, refundAmount);
        emit RefundIssued(policyId, policy.owner, refundAmount);
    }

    /// @notice Test version of cancelPolicy with signature verification
    function cancelPolicyWithSignature(
        bytes32 policyId,
        uint256 refundAmount,
        bytes memory signature
    ) public onlyRole(ADMIN_ROLE) validPolicy(policyId) nonReentrant {
        Policy storage policy = policies[policyId];
        require(!policy.isClaimed, "Policy already claimed");
        require(block.timestamp < policy.expiry, "Policy expired");

        // Create hash of the refund parameters for signature verification
        bytes32 messageHash = keccak256(
            abi.encodePacked(
                policyId,
                refundAmount,
                block.chainid
            )
        );

        // Verify signature isn't used already
        require(!usedSignatures[keccak256(signature)], "Signature already used");

        // Prefix the hash with Ethereum message prefix: "\x19Ethereum Signed Message:\n32"
        bytes32 ethSignedMessageHash = keccak256(
            abi.encodePacked("\x19Ethereum Signed Message:\n32", messageHash)
